import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Import Pages
import Index from './pages/index'

export default function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/' element={<Index/>} errorElement={<Index/>} />
        </Routes>
      </Router>
    </div>
  );
}
